"use strict";(self.webpackChunk_map_colonies_developer_portal=self.webpackChunk_map_colonies_developer_portal||[]).push([[7262],{59834:e=>{e.exports=JSON.parse('{"tag":{"label":"valhalla","permalink":"/developer-portal/pr-preview/pr-153/docs/tags/valhalla","allTagsPath":"/developer-portal/pr-preview/pr-153/docs/tags","count":7,"items":[{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-expansion","title":"Expansion API","description":"Routing algorithms find the best path by expanding their search from start nodes/edges across the routing network until the destination is reached (unidirectional) or both search branches meet (bidirectional).","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-expansion"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-isochrone","title":"Isochrone API","description":"An isochrone is a line that connects points of equal travel time about a given location, from the Greek roots of iso for equal and chrone for time. Valhalla\'s isochrone service computes areas that are reachable within specified time intervals from a location, and returns the reachable regions as contours of polygons or lines that you can display on a map.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-isochrone"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-locate","title":"Locate API","description":"Valhalla\'s locate service, is an open-source service that provides detailed information about streets and intersections close to an input point with some added matching criteria. This allows for tight integration in routing and navigation applications on web or mobile.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-locate"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-matrix","title":"Matrix API","description":"Valhalla\'s time-distance matrix service provides a quick computation of time and distance between a set of locations and returns them to you in the resulting matrix table.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-matrix"},{"id":"MapColonies/openstreetmap/valhalla/osm-valhalla-optimized-route","title":"Optimized Route API","description":"The Optimized Route service provides a quick computation of time and distance between a set of location sources and location targets and returns them in an optimized route order, along with the shape.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/osm-valhalla-optimized-route"},{"id":"MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-overview","title":"Overview","description":"The Valhalla route service (a.k.a. turn-by-turn) is an open-source routing service that lets you integrate routing and navigation into a web or mobile application. The service works globally, and provides dynamic and customizable routing by driving, walking, bicycling, and using multimodal and transit options, with clear directions for maneuvers along the route.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-overview"},{"id":"MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-route","title":"Route API","description":"Valhalla\'s routing service (a.k.a. turn-by-turn), is an open-source routing service that lets you integrate routing and navigation into a web or mobile application.","permalink":"/developer-portal/pr-preview/pr-153/docs/MapColonies/openstreetmap/valhalla/turn-by-turn/osm-valhalla-route"}],"unlisted":false}}')}}]);